INSERT INTO `internet_info` VALUES ('127', '北京人民艺术剧院', 'https://baike.baidu.com/item/%E5%8C%97%E4%BA%AC%E4%BA%BA%E6%B0%91%E8%89%BA%E6%9C%AF%E5%89%A7%E9%99%A2', '\n北京人民艺术剧院是一个具有独特表演风格的中外闻名的专业话剧院，始建于1952年6月，首任院长为著名剧作家曹禺', '2019-4-28');
INSERT INTO `internet_info` VALUES ('128', '阳春（广东省阳春市）', 'https://baike.baidu.com/item/%E9%98%B3%E6%98%A5/3333?fromtitle=%E9%98%B3%E6%98%A5%E5%B8%82&fromid=3300308', '\n阳春，南朝梁普通四年（523年），撤销莫阳县，改设阳春郡并置阳春县，这是以“阳春”名建县之始，意取“漠水之阳，四季如春”', '2019-4-28');
