INSERT INTO `internet_info` VALUES ('130', '区块链（数据结构）', 'https://baike.baidu.com/item/%E5%8C%BA%E5%9D%97%E9%93%BE/13465666', '\n区块链是分布式数据存储、点对点传输、共识机制、加密算法等计算机技术的新型应用模式', '2019-04-29 15:03');
INSERT INTO `internet_info` VALUES ('131', '数据库', 'https://baike.baidu.com/item/%E6%95%B0%E6%8D%AE%E5%BA%93', '\n数据库，简而言之可视为电子化的文件柜——存储电子文件的处所，用户可以对文件中的数据进行新增、截取、更新、删除等操作', '2019-04-29 15:03');
INSERT INTO `internet_info` VALUES ('132', '加密算法', 'https://baike.baidu.com/item/%E5%8A%A0%E5%AF%86%E7%AE%97%E6%B3%95', '\n数据加密的基本过程就是对原来为明文的文件或数据按某种算法进行处理，使其成为不可读的一段代码，通常称为“密文”，使其只能在输入相应的密钥之后才能显示出本来内容，通过这样的途径来达到保护数据不被非法人窃取、阅读的目的', '2019-04-29 15:03');
INSERT INTO `internet_info` VALUES ('133', '比特币（虚拟货币）', 'https://baike.baidu.com/item/%E6%AF%94%E7%89%B9%E5%B8%81/4143690', '\n比特币（Bitcoin）的概念最初由中本聪在2008年11月1日提出，并于2009年1月3日正式诞生\n[1] \n', '2019-04-29 15:03');
INSERT INTO `internet_info` VALUES ('134', '分布式（计算机的一种算法）', 'https://baike.baidu.com/item/%E5%88%86%E5%B8%83%E5%BC%8F/19276232', '\n什么是分布式计算？所谓分布式计算是一门计算机科学，它研究如何把一个需要非常巨大的计算能力才能解决的问题分成许多小的部分，然后把这些部分分配给许多计算机进行处理，最后把这些计算结果综合起来得到最终的结果', '2019-04-29 15:03');
