INSERT INTO `internet_info` VALUES ('148', '数字城市', 'https://baike.baidu.com/item/%E6%95%B0%E5%AD%97%E5%9F%8E%E5%B8%82', '\n“数字城市”（英文：digital city）\n[1] \n以计算机技术、多媒体技术和大规模存储技术为基础，以宽带网络为纽带，运用遥感、全球定位系统、地理信息系统、工程测量技术、仿真-虚拟等技术，对城市进行多分辨率、多尺度、多时空和多种类的三维描述，即利用信息技术手段把城市的过去、现状和未来的全部内容在网络上进行数字化虚拟实现', '2019-04-29 15:03');
