INSERT INTO `internet_info` VALUES ('155', '运维工程师', 'https://baike.baidu.com/item/%E8%BF%90%E7%BB%B4%E5%B7%A5%E7%A8%8B%E5%B8%88', '\n运维工程师(Operations)，负责维护并确保整个服务的高可用性，同时不断优化系统架构提升部署效率、优化资源利用率提高整体的ROI.运维工程师面对的最大挑战是大规模集群的管理问题，如何管理好几十万台服务器上的服务，同时保障服务的高可用性，是运维工程师面临的最大挑战', '2019-04-29 15:03');
INSERT INTO `internet_info` VALUES ('156', '运维', 'https://baike.baidu.com/item/%E8%BF%90%E7%BB%B4', '\n运维，这里指互联网运维，通常属于技术部门，与研发、测试、系统管理同为互联网产品技术支撑的4大部门，这个划分在国内和国外以及大小公司间都会多少有一些不同', '2019-04-29 15:03');
