INSERT INTO `internet_info` VALUES ('159', 'Apache Mesos', 'https://baike.baidu.com/item/Apache%20Mesos', '\nApache Mesos是由加州大学伯克利分校的AMPLab首先开发的一款开源群集管理软件，支持Hadoop、ElasticSearch、Spark、Storm 和Kafka等应用架构', '2019-04-29 15:03');
