INSERT INTO `internet_info` VALUES ('708', '诺基亚Lumia 930', 'https://baike.baidu.com/item/%E8%AF%BA%E5%9F%BA%E4%BA%9ALumia%20930/3083689?fromtitle=%E8%AF%BA%E5%9F%BA%E4%BA%9A930&fromid=1951188', '\nLumia 930搭载了强劲的2.2GHz骁龙800处理器，内置2GB RAM+32GB机身存储（不支持扩展）；采用5英寸超敏感的ClearBlack AMOLED全高清屏，分辨率达1920×1080像素级别，像素密度为441ppi；具备2000万像素Pureview主摄像头和120万像素前置广角镜头，1/2.5英寸BSI（背面照射）传感器、f/2.4光圈、支持OIS光学防抖，并配有双LED闪光灯；机身内置4颗麦克风，可实现立体环绕声视频拍摄以及定向音频录制，同时，它还支持以30fps帧速拍摄1080p视频', '2019-04-29 17:05');
INSERT INTO `internet_info` VALUES ('709', '胃蛋白酶', 'https://baike.baidu.com/item/%E8%83%83%E8%9B%8B%E7%99%BD%E9%85%B6', '\n胃蛋白酶（英文名称：Pepsin）是一种消化性蛋白酶，由胃部中的胃粘膜主细胞（gastric chief cell）所分泌，功能是将食物中的蛋白质分解为小的肽片段', '2019-04-29 17:05');
