INSERT INTO `internet_info` VALUES ('711', '圣彼得堡（俄罗斯城市）', 'https://baike.baidu.com/item/%E5%9C%A3%E5%BD%BC%E5%BE%97%E5%A0%A1/6447', '\n圣彼得堡，位于俄罗斯西北部，波罗的海沿岸，涅瓦河口，处于北纬59°~60° 、东经29°~30°之间，是俄罗斯的中央直辖市，列宁格勒州的首府，俄罗斯西北地区中心城市，全俄重要的水陆交通枢纽，是世界上人口超过百万的城市中位置最北的一个，又被称为俄罗斯的“北方首都”', '2019-04-29 17:05');
