INSERT INTO `internet_info` VALUES ('730', '亚历山大·谢尔盖耶维奇·普希金', 'https://baike.baidu.com/item/%E4%BA%9A%E5%8E%86%E5%B1%B1%E5%A4%A7%C2%B7%E8%B0%A2%E5%B0%94%E7%9B%96%E8%80%B6%E7%BB%B4%E5%A5%87%C2%B7%E6%99%AE%E5%B8%8C%E9%87%91/965899?fromtitle=%E6%99%AE%E5%B8%8C%E9%87%91&fromid=121349', '\n亚历山大·谢尔盖耶维奇·普希金（Александр Сергеевич Пушкин；1799年6月6日\n[1] \n—1837年2月10日），是俄罗斯著名文学家、诗人、小说家，现代俄国文学的创始人，19世纪俄罗斯浪漫主义文学主要代表，同时也是现实主义文学的奠基人，现代标准俄语的创始人，被誉为“俄罗斯文学之父”、“俄罗斯诗歌的太阳”，“青铜骑士”', '2019-04-29 17:05');
