INSERT INTO `internet_info` VALUES ('845', '中华人民共和国土地增值税暂行条例', 'https://baike.baidu.com/item/%E4%B8%AD%E5%8D%8E%E4%BA%BA%E6%B0%91%E5%85%B1%E5%92%8C%E5%9B%BD%E5%9C%9F%E5%9C%B0%E5%A2%9E%E5%80%BC%E7%A8%8E%E6%9A%82%E8%A1%8C%E6%9D%A1%E4%BE%8B', '\n土地增值税是指转让国有土地使用权、地上的建筑物及其附着物并取得收入的单位和个人，以转让所取得的收入包括货币收入、实物收入和其他收入为计税依据向国家缴纳的一种税赋，不包括以继承、赠与方式无偿转让房地产的行为', '2019-04-29 17:05');
INSERT INTO `internet_info` VALUES ('846', '王作安（中央统战部副部长，国家宗教事务局局长）', 'https://baike.baidu.com/item/%E7%8E%8B%E4%BD%9C%E5%AE%89/36988', '\n王作安， 男，汉族，1958年5月生，江苏宜兴人，1985年6月加入中国共产党，1977年9月参加工作，大学学历', '2019-04-29 17:05');
