INSERT INTO `internet_info` VALUES ('848', '马克思列宁主义', 'https://baike.baidu.com/item/%E9%A9%AC%E5%85%8B%E6%80%9D%E5%88%97%E5%AE%81%E4%B8%BB%E4%B9%89/9153690?fromtitle=%E9%A9%AC%E5%88%97%E4%B8%BB%E4%B9%89&fromid=243800', '\n马克思列宁主义（俄语：марксизм-ленинизм），简称为马列主义或马列，严格的说是指由列宁发展起来的马克思主义', '2019-04-29 17:05');
