INSERT INTO `internet_info` VALUES ('852', '求是（中共中央的机关刊物）', 'https://baike.baidu.com/item/%E6%B1%82%E6%98%AF/9843864', '\n《求是》杂志是中国共产党中央委员会主办的机关刊，是中共中央指导全党全国工作的重要思想理论阵地，担负着深入宣传马克思列宁主义、毛泽东思想和中国特色社会主义理论体系，宣传贯彻习近平总书记系列重要讲话精神，宣传阐释党的路线方针政策和中央决策部署，总结宣传各地各部门实际工作经验，回答干部群众关心的重大理论和现实问题，提高全党的马克思主义理论水平，巩固马克思主义在意识形态领域的指导地位，巩固全党全国人民团结奋斗的共同思想基础的重要任务', '2019-04-29 17:05');
