INSERT INTO `internet_info` VALUES ('900', '鉴定', 'https://baike.baidu.com/item/%E9%89%B4%E5%AE%9A', '\n鉴定是指本人工作、学习、劳动一个时期或工作调动以及参加临时工作结束时本人写的优、缺点总结和组织上做的评语；鉴定是指为了查明案情，解决案件中某些专门性问题，由侦查机关指派或聘请具有专门知识的人，就案件中的专门性问题进行科学鉴别和判断的一种侦查行为；鉴定是指，具有相应能力和资质的专业人员或机构受具有相应权力或管理职能部门或机构的委托，根据确凿的数据或证据、相应的经验和分析论证对某一事物提出客观、公正和具有权威性的技术仲裁意见，这种意见作为委托方处理相关矛盾或纠纷的证据或依据', '2019-04-29 17:05');
INSERT INTO `internet_info` VALUES ('901', 'X射线', 'https://baike.baidu.com/item/X%E5%B0%84%E7%BA%BF/836137?fromtitle=x%E5%85%89&fromid=582883', '\nX射线\n[1] \n是一种波长极短，能量很大的电磁波，X射线的波长比可见光的波长更短(约在0.001～10纳米，医学上应用的X射线波长约在0.001～0.1 纳米之间)，它的光子能量比可见光的光子能量大几万至几十万倍\n[2] \n', '2019-04-29 17:05');
